import{_ as t,c as a,o,a3 as i}from"./chunks/framework.CkaDlzKP.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"AI/0.课程基础知识/Python/Jupyter notebook.md","filePath":"AI/0.课程基础知识/Python/Jupyter notebook.md","lastUpdated":1754900608000}'),n={name:"AI/0.课程基础知识/Python/Jupyter notebook.md"};function l(s,e,r,p,d,c){return o(),a("div",null,e[0]||(e[0]=[i('<h2 id="官方手册" tabindex="-1">官方手册 <a class="header-anchor" href="#官方手册" aria-label="Permalink to &quot;官方手册&quot;">​</a></h2><p><a href="https://docs.jupyter.org/en/latest/" target="_blank" rel="noreferrer">Project Jupyter 文档 — Jupyter 文档 4.1.1 Alpha 文档 --- Project Jupyter Documentation — Jupyter Documentation 4.1.1 alpha documentation</a></p><p>jupyter就是一个python编译器，只不过套了一层浏览器的外衣</p><h2 id="启动jupyter-notebook" tabindex="-1">启动Jupyter notebook <a class="header-anchor" href="#启动jupyter-notebook" aria-label="Permalink to &quot;启动Jupyter notebook&quot;">​</a></h2><ol><li>在终端输入回车</li></ol><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>jupyter notebook</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><ol start="2"><li>十几秒内，会自动打开一个网页（此终端不要关闭）</li><li>如果你在桌面启动的终端，此时网页上的目录就是桌面的目录</li><li>如何在想要的地方启动终端？可以在该文件夹的搜索框内输入cmd<img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601090842.XRlL5uhh.png" alt=""></li><li>在这个终端页面输入jupyter notebook,此时会以此目录打开网页</li><li>另外建议将Chrome设为默认浏览器</li></ol><h2 id="界面介绍" tabindex="-1">界面介绍 <a class="header-anchor" href="#界面介绍" aria-label="Permalink to &quot;界面介绍&quot;">​</a></h2><p><img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601091831.BVmUAX_B.png" alt="">在浏览器页面 选择右侧的NEW，新建一个Notebook文件</p><p><img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601091602.CcZdMWIz.png" alt=""></p><p>在光标闪烁的位置输入代码 按下</p><blockquote><p>ctrl enter</p></blockquote><p>就会执行代码<img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601091852.D3uerdG-.png" alt=""></p><h3 id="笔记的单元格" tabindex="-1">笔记的单元格 <a class="header-anchor" href="#笔记的单元格" aria-label="Permalink to &quot;笔记的单元格&quot;">​</a></h3><p>一个cell就是一个单元格</p><p>有两种状态：</p><ol><li>编辑状态（鼠标键入，有光标闪烁时）</li><li>选中状态（点击cell输入框旁边的空白区域）</li></ol><p>编辑状态按ESC快速选中状态 选中状态按Enter快速进入编辑状态</p><h4 id="对单元格的操作-都在选中状态下操作" tabindex="-1">对单元格的操作（都在选中状态下操作） <a class="header-anchor" href="#对单元格的操作-都在选中状态下操作" aria-label="Permalink to &quot;对单元格的操作（都在选中状态下操作）&quot;">​</a></h4><ol><li>增加单元格（单击b键在下方新增，单击a在上方新增）</li><li>删除单元格（双击d，删除当前选中的单元格）</li><li>剪切单元格（单击x就剪切了，选中一个单元格位置，再单击v，会将剪切的粘到当前单元格的下方）</li><li>撤销操作（任意位置单击z键）</li></ol><p>有两种以上的模式<img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601094420.D898xh3O.png" alt=""></p><ol><li>Code模式就是python能运行的代码</li><li>Markdown跟做笔记一样，主要是写一些说明（写完之后记得按Ctrl enter，文本才会进入预览模式）<img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601094941.CnV8TdRu.png" alt=""></li></ol><p>不会Markdown的可以看这个网站，5分钟学会，能用一辈子 <a href="https://www.markdown.cn/docs/tutorial-basics/basic-syntax" target="_blank" rel="noreferrer">基本语法 | MARKDOWN 中文</a></p><p>选中时按y进入code模式 按m进入markdown模式</p><p>想给当前这个notebook改名的话可以这样操作<img src="https://obsidiannote.netlify.app/assets/Pasted%20image%2020250601095306.DDUN40Xo.png" alt=""></p>',25)]))}const b=t(n,[["render",l]]);export{u as __pageData,b as default};
